import React from "react";

import {
  Route,
  HashRouter,
  NavLink,
} from "react-router-dom";
import Math from "./components/Math"

function Courses () {
    return (
      <div>
        <h2>COURSES</h2>
        <p>Mentee courses will be listed here</p>

        <ul className="header">
            <li><NavLink exact to="/">Math</NavLink></li>

         </ul>
         <div className="content">

            <Route path="/math" component={Math}/>

          <li>Math</li>
          <li>Science</li>
          <li>Engeeniering</li>
          <li>Arts</li>
          <li>Computing</li>

      </div>
      </div>
    )
  }


export default Courses;
